import React from 'react';
import { Link as ScrollLink } from 'react-scroll'; // Para el desplazamiento suave

const Navbar = () => {
  const sections = [
    { name: "Inicio", id: "Inicio" },
    { name: "Nuestros Productos", id: "NuestrosProductos" },
    { name: "Quienes Somos", id: "QuienesSomos" },
    { name: "Nuestros Clientes", id: "NuestrosClientes" },
    { name: "Contacto", id: "Contacto" },
  ];

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <a href="#Inicio" className="navbar-brand">Mi Logo</a>
        <ul className="navbar-links">
          {sections.map((section) => (
            <li key={section.id} className="nav-item">
              <ScrollLink
                className="nav-link"
                to={section.id}
                smooth={true}
                duration={500}
              >
                {section.name}
              </ScrollLink>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
